import logo from './logo.svg';
import './App.css';
import Header from "./Header";
import Spinner from "react-bootstrap/Spinner";
import Carga from './Carga';
import SearchPage from "./SearchPage";
import Producto from './Producto';
import NoMatch from './NoMatch';
import { mockdata } from "./constants/products";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route } from "react-router-dom";
import CONFIG from './config/config';

function App() {
  function renderizando() {
    setTimeout(<Carga/>, CONFIG.loading_timeout_ms)
  }

  /* const [productos, setProducto] = useState(mockdata.products); */
  return (
    <div className="App">
      <Header />
      
      <Routes>
      <Route path="/" element={renderizando()} /> 
        {/* <Route path="/" element={<SearchPage theproducts={mockdata.products} />} /> */}
        <Route path="/products/:productId" element={<Producto productos={mockdata.products} />} />
        <Route path="*" element={<NoMatch />} />
      </Routes>

      {/*productos && <SearchPage theproducts={productos}/> */}
    </div>
  );
}

export default App;
